using System;
using System.IO;
using System.Net.Http;
using Microsoft.VisualStudio.TestTools.UnitTesting;


namespace Scryber.Core.UnitTests.Imaging
{

    [TestClass()]
    public class ImageTypeTests
    {
        [TestMethod()]
        public void ImagesInDataUrls()
        {
             var template =
                """
                <?scryber parser-mode='lax' ?>
                <html xmlns='http://www.w3.org/1999/xhtml'>

                <head>
                    <title>Image tests</title>
                    <style>
                        .title {
                            background-color: #00b6b6;
                            color: #fff;
                            padding: 10pt;
                        }

                        .base64 {
                            background-image: url("data:image/png;base64,");
                            width: 128px;
                            height: 128px;
                            background-size: cover;
                        }

                        .url {
                            background-image: url('https://github.com/richard-scryber/Scryber.Core.Samples/blob/master/Scryber.SampleFiles/HTML/assets/ScyberLogo2_alpha_small.png?raw=true');
                            width: 128px;
                            height: 128px;
                            background-size: cover;
                        }

                        .file {
                            background-image: url('ScyberLogo2_alpha_small.png');
                            width: 128px;
                            height: 128px;
                            background-size: cover;
                        }
                    </style>
                </head>

                <body>
                    <h1 class='title'>Image usage samples</h1>
                    <p>ImageExist: {{Model.ImageExist}}</p>
                    <p>ImageSourceRelativePath: {{Model.ImageSourceRelativePath}}</p>
                    <p>ImageSourceFullPath: {{Model.ImageSourceFullPath}}</p>

                    <h2 class='title'>Image test from Url, File, Css...</h2>
                    <table>
                        <tr>
                            <td>
                                <h4>From Url</h4>
                                <img id="ImageUrl" alt="ImageUrl" src="https://github.com/richard-scryber/Scryber.Core.Samples/blob/master/Scryber.SampleFiles/HTML/assets/ScyberLogo2_alpha_small.png?raw=true" width="128" height="128" />
                            </td>
                            <td>
                                <h4>From File</h4>
                                <img id="ImageFile" alt="ImageFile" src="ScyberLogo2_alpha_small.png" width="128" height="128" />
                            </td>
                        </tr>
                        <tr>
                            <td>
                                <h4>From Base64</h4>
                                <img id="ImageBase64" alt="ImageBase64" src="data:image/png;base64," width="128" height="128" />
                            </td>
                            <td>
                                <h4>From Div Background Base64 </h4>
                                <div id="DivBackgroundBase64" alt="DivBackgroundBase64" class="base64" width="128" height="128"></div>
                            </td>
                        </tr>
                        <tr>
                            <td>
                                <h4>From Div Background Url </h4>
                                <div id="DivBackgroundUrl" alt="DivBackgroundUrl" class="url" width="128" height="128"></div>
                            </td>
                            <td>
                                <h4>From code by searching Image by Id and set PDFImageDataBase</h4>
                                <div id="DivBackgroundFile" alt="DivBackgroundFile" class="file" width="128" height="128"></div>
                            </td>
                        </tr>
                    </table>

                    <h2 class='title'>Image test from code</h2>
                    <table>
                        <tr>
                            <td>
                                <h4>From code by Model property ImageData</h4>
                                <img id="ImageModelImageData" data-img="{@:Model.ImageData}" alt="ImageModelImageData" width="128" height="128" />
                            </td>
                            <td>
                                <h4>From code by Model property PDFImageDataBase</h4>
                                <img id="ImageModelPDFImageDataBase" data-img="{@:Model.PDFImageDataBase}" alt="ImageModelPDFImageDataBase" width="128" height="128" />
                            </td>
                        </tr>
                        <tr>
                            <td>
                                <h4>From code by Model property ImageSourceFullPath</h4>
                                <img id="ImageModelImageSourceFullPath" src="{@:Model.ImageSourceFullPath}" alt="ImageModelImageSourceFullPath" width="128" height="128" />
                            </td>
                            <td>
                                <h4>From code by Model property ImageSourceRelativePath</h4>
                                <img id="ImageModelImageSourceRelativePath" src="{@:Model.ImageSourceRelativePath}" alt="ImageModelImageSourceRelativePath" width="128" height="128" />
                            </td>
                        </tr>
                        <tr>
                            <td>
                                <h4>From code by searching Image by Id and set ImageData</h4>
                                <img id="ImageCodeImageData" alt="ImageCodeImageData" width="128" height="128" />
                            </td>
                            <td>
                                <h4>From code by searching Image by Id and set PDFImageDataBase</h4>
                                <img id="ImageCodePDFImageDataBase" alt="ImageCodePDFImageDataBase" width="128" height="128" />
                            </td>
                        </tr>
                        <tr>
                            <td>
                                <h4>From code by searching Image by Id and set Source Full Path</h4>
                                <img id="ImageCodeImageSourceFullPath" alt="ImageCodeImageSourceFullPath" width="128" height="128" />
                            </td>
                            <td>
                                <h4>From code by searching Image by Id and set Source Relative Path</h4>
                                <img id="ImageCodeImageSourceRelativePath" alt="ImageCodeImageSourceRelativePath" width="128" height="128" />
                            </td>
                        </tr>
                    </table>
                </body>

                </html>
                """;

            string pdfFilePath = Directory.GetCurrentDirectory() + $"\\{DateTime.Now:yyyyMMdd-HHmmss}_TestImages.pdf";

            string url = "https://github.com/richard-scryber/Scryber.Core.Samples/blob/master/Scryber.SampleFiles/HTML/assets/ScyberLogo2_alpha_small.png?raw=true";

            var imagePath = Directory.GetCurrentDirectory() + "/Content/HTML/Images/ScyberLogo2_alpha_small.png";
            var imagePathExist = System.IO.File.Exists(imagePath);

            if (!imagePathExist)
            {
                using HttpClient client = new System.Net.Http.HttpClient();
                byte[] imageBytes = client.GetByteArrayAsync(url).GetAwaiter().GetResult();
                System.IO.File.WriteAllBytesAsync("ScyberLogo2_alpha_small.png", imageBytes).GetAwaiter().GetResult();

                imagePathExist = System.IO.File.Exists(imagePath);
            }

            //Use SixLabours to load the image however you need (in this case just from a path)
            SixLabors.ImageSharp.Image image = SixLabors.ImageSharp.Image.Load(imagePath);

            //Convert the SixLabours image to PDFImageData.
            Scryber.Imaging.PDFImageDataBase pdfImageDataBase = Scryber.Imaging.ImageFactoryBase.GetImageDataForImage(image, imagePath);

            // myImage4 myImage5 myImage6
            var model = new
            {
                ImageData = pdfImageDataBase,
                PDFImageDataBase = pdfImageDataBase,
                ImageExist = imagePathExist,
                ImageSourceRelativePath = "ScyberLogo2_alpha_small.png",
                ImageSourceFullPath = imagePath
            };

            // Crear un MemoryStream a partir del arreglo de bytes
            using var streamTemplate = new MemoryStream(System.Text.Encoding.UTF8.GetBytes(template));
            using var doc = Scryber.Components.Document.ParseDocument(streamTemplate);

            doc.AppendTraceLog = true;
            doc.Params["Model"] = model;

            Scryber.Components.Image? imageCodeImageData = doc.FindAComponentById("ImageCodeImageData") as Scryber.Components.Image;
            if (imageCodeImageData != null)
            {
                imageCodeImageData.Data = model.ImageData;
            }

            Scryber.Components.Image? imageCodePDFImageDataBase = doc.FindAComponentById("ImageCodePDFImageDataBase") as Scryber.Components.Image;
            if (imageCodePDFImageDataBase != null)
            {
                imageCodePDFImageDataBase.Data = model.PDFImageDataBase;
            }

            Scryber.Components.Image? imageCodeImageSourceRelativePath = doc.FindAComponentById("ImageCodeImageSourceRelativePath") as Scryber.Components.Image;
            if (imageCodeImageSourceRelativePath != null)
            {
                imageCodeImageSourceRelativePath.Source = model.ImageSourceRelativePath;
            }

            Scryber.Components.Image? imageCodeImageSourceFullPath = doc.FindAComponentById("ImageCodeImageSourceFullPath") as Scryber.Components.Image;
            if (imageCodeImageSourceFullPath != null)
            {
                imageCodeImageSourceFullPath.Source = model.ImageSourceFullPath;
            }

            doc.SaveAsPDF(pdfFilePath);
        }
    }
}